sap.ui.define([],function(){"use strict";return{stripHTML:function(t){if(t){return t.replace(/<[^>]*>?/gm,"")}else{return t}},stripAndTruncateHTML:function(t){if(t){t=t.replace(/<[^>]*>?/gm,"");if(t.length>50){t=t.substring(0,50)+" ..."}return t}else{return t}},momentTimeAgo:function(t){return moment.utc(t,"YY-MM-DD").fromNow()},momentShortDate:function(t){if(t){return moment.utc(t).format("MM/DD/YYYY")}else{return""}},momentDate:function(t){if(t){return moment.utc(t).format("MMM Do YYYY")}else{return""}},momentDateMonthName:function(t){if(t){var e=t.split("/")[0]+"/01/"+t.split("/")[1];return moment(e).format("MMMM")}else{return""}},contentId:function(t){return new Date(t).getTime()},statusText:function(t){var e=this.getView().getModel("i18n").getResourceBundle();switch(t){case"A":return e.getText("invoiceStatusA");case"B":return e.getText("invoiceStatusB");case"C":return e.getText("invoiceStatusC");default:return t}}}});